function ItemsData(props) {

const itemsData = [
    {
    id: 1,
    name: "Boston Celtics",
    img: "http://dummyimage.com/280x260.png/cc0000/ffffff",
    precio: 122,
    descripcion: "NBA jerseys",
    stock: 7,
    },
    {
        id: 2,
        name: "Golden State Warriors",
        img: "http://dummyimage.com/280x260.png/cc0000/ffffff",
        precio: 134,
        descripcion: "NBA jerseys",
        stock: 7,
    },
    {
        id: 3,
        name: "Lakers",
        img: "http://dummyimage.com/280x260.png/cc0000/ffffff",
        precio: 180,
        descripcion: "NBA jerseys",
        stock: 7,
    },
    {
        id: 4,
        name: "Miami Heat",
        img: "http://dummyimage.com/280x260.png/cc0000/ffffff",
        precio: 128,
        descripcion: "NBA jerseys",
        stock: 7,
    },
];
}
export default itemsData;
